constructor(props) {
    // Required step: always call the parent class' constructor
    super(props);
    
    // Set the state directly. Use props if necessary.
    this.state = {
        items: [1,2,3,4],
        currentValue: null,
        single_class: null,
        currentKey: null,
        history: ["ASU 101"],
    }

    // this.fetchPreReq()

    // this.checkIfCanTake()

    // setInterval(function(){this.checkIfCanTake()}.bind(this),2000)
}

handleTargetChange(){

if (document.getElementById("targetClass").value.length < 7 ){
	return;
} else {
	

  this.setState({currentKey: document.getElementById("targetClass").value } )

  setTimeout(()=>{

	  this.fetchPreReq()
	  this.checkIfCanTake()
	  
}, 500)

}



}
checkIfCanTake() {
console.log(this)
    fetch("/can_i_take", {
      "method": "POST",
      "headers": {
        "content-type": "application/json"
      },
      "body": JSON.stringify({
        "class": this.state.currentKey,
        "history": this.state.history
      })
    })
    .then(response => {
        response.json().then(r =>{
        console.log(r)
           this.setState({currentValue: r})
        })
    })
    .catch(err => {
      console.log(err);
    });    }
fetchPreReq(e) {
    fetch("/single_class", {
      "method": "POST",
      "headers": {
        "content-type": "application/json"
      },
      "body": JSON.stringify({
        "class": this.state.currentKey
      })
    })
    .then(response => {
        response.json().then(r =>{
           this.setState({single_class: r[0]})
        })
    })
    .catch(err => {
      console.log(err);
    });
}


addNewClassHistory(){
  this.setState({history: 
    [...this.state.history, document.getElementById("classToAdd").value ]
  })

  setTimeout(()=>{

    this.fetchPreReq()
  this.checkIfCanTake()
  console.log("yo")
}, 500)

}


render() {
    return (
    
<section>

<div className="container">

<div className="card panel">

              {
              this.state.history.map((v, i) => { 

return(
<div className="eachClass">
    <div className="card-body">{v}</div>
</div>)
            })
              }


<br/>



<h4>âž• Add Class</h4>



<div className="input-group input-group-sm mb-3">

  <input id="classToAdd" className="typeahead tt-query" aria-label="Small" aria-describedby="inputGroup-sizing-sm"/>

  <div className="input-group-prepend">
    <span onClick={this.addNewClassHistory.bind(this)} className="input-group-text" id="inputGroup-sizing-sm">Add</span>
  </div>
</div>



</div>

<br/>
<br/>
<div className="card panel">


<h4>ðŸš€ Want to take</h4>


<input 
id="targetClass"
onChange={this.handleTargetChange.bind(this)}
onSelect={this.handleTargetChange.bind(this)}
type="text" className="typeahead tt-query" 
autoComplete="off" spellCheck="false"/>

</div>
          </div>
          <div className="col-sm">

<div className="card panel">

              { 
                this.state.currentValue != null && 
                <div>{
                      this.state.currentValue.can_take == true ? 
                      <h4>ðŸŽ‰ Yay, You Can Take</h4> : <h4>ðŸ¤š Wait, You Cannot Take</h4> 
                    }
                </div>
              }

<nav className="navbar navbar-expand-lg navbar-light bg-light resultBar">



{              
	this.state.single_class &&
                <div><h4>{this.state.single_class.crse}</h4></div>
}
</nav>

<br/>

<div className="card panel">


  <h4>Eligibility</h4>

              { 
                this.state.currentValue != null && 
                this.state.currentValue.can_take == true ? 
                	<div>You did complete at least one the following: </div> : 
                	<div>You need to complete one or more of the following: </div> 
              }
<ul className="nav nav-pills">

              { this.state.currentValue != null && 
                this.state.currentValue.did_not_complete.map((v,i)=><li className="doesnot" >{v}</li>)
              }
              { this.state.currentValue != null && 
                this.state.currentValue.did_complete.map((v,i)=><li className="has" >{v}</li>)
              }

</ul> 
	</div>

<br/>
              { this.state.single_class != null && 
                this.state.single_class.input &&
                <p>{this.state.single_class.input}</p>
              }

              <h4>Prereq Breakout</h4>
              { this.state.single_class != null && 
                this.state.single_class.list_pre_reqs &&
                this.state.single_class.list_pre_reqs.map((v,i)=> {

                let kist = [];
                  Object.keys(v.classified).map((w,j)=>{
                  kist.push(<li className={v.classified[w] ? "has" : "doesnot"} 
                  style={{"display": v.classified[w] ? "block" : "none"}}>
                  {w.substr(3, w.length).replace(/_/g, " ")}
              </li>)
                })

                  return(
                  <div>
                    <div>{v.original}</div>
                    <ul className="nav nav-pills">
                    {kist}
                    </ul>
                  </div>


                  )
                })
              }


          </div>
          </div>
      </div>
    </div>
</section>
    );
}
